import React from 'react';
import spinner from './spinner.gif';
import ClipLoader from "react-spinners/ClipLoader";

const Spinner = ({size}) => {
  const override = css`
  display: block;
  margin: 0 auto;
  border-color: red;
  `;
  return(
    <>
      <ClipLoader size={size}/>
    </>
  )
}

export default Spinner;
